// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./SoulAuction.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";

contract NFSoul is SoulAuction, PausableUpgradeable {
    mapping(uint256 => Soul) _souls;
    mapping(address => uint256) soulOwner;

    event TestBuy(uint256 soulId); // fore test
    event ReceiveUnknownPaymentRecieve(address sender, uint256 value);
    event ReceiveUnknownPaymentFallback(address sender, uint256 value);

    struct Soul {
        bytes4 fb;
        uint256 phone;
    }

    function soulExists(uint256 soulId) public view returns (bool) {
        return _exists(soulId);
    }

    function initialize(address account) public initializer {
        _init(account);
        __ERC721_init("Soul", "NFS");
    }

    // Auction function
    function reclaimSoul(uint256 soulId) public {
        _reclaimSoul(soulId);
    }

    function returnSoulToAuction(uint256 soulId) public {
        _returnSoulToAuction(soulId);
    }

    function getActualPrice(uint256 soulId) public view {
        _getActualPrice(soulId);
    }

    function timeIsOver(uint256 soulId) public view {
        _timeIsOver(soulId);
    }

    function updateAuction(uint256 soulId) public {
        _updateAuction(soulId);
    }

    // Admin functions
    function addAdmin(address addr) public {
        // tested
        _addAdmin(addr);
    }

    function isAdmin(address account) public view returns (bool) {
        return _isAdmin(account);
    }

    function removeAdmin(address addr) public {
        // tested
        _removeAdmin(addr);
    }

    function pause() public {
        _pause();
    }

    function unpause() public {
        _unpause();
    }

    function getPauseStatus() public view returns (bool) {
        // Check after deploy
        return paused();
    }

    function setServicePiece(uint256 piece) public {
        _setServicePiece(piece);
    }

    function setOwnerPiece(uint256 piece) public {
        _setOwnerPiece(piece);
    }

    function setPieAddress(address pieToken) public {
        _setPieAddress(pieToken);
    }

    function setDuration(uint256 auctionTime) public {
        _setDuration(auctionTime);
    }

    function setMinPrice(uint256 minPrice) public {
        _setMinPrice(minPrice);
    }

    // Modification functions
    function setDonorMod(uint256 soulId, uint8 typeMod) public {
        _setDonorMod(soulId, typeMod);
    }

    function setCommonMods(uint256 soulId, bytes32 modification) public {
        _setModification(soulId, modification);
    }

    // Receive and Fallback
    receive() external payable {
        emit ReceiveUnknownPaymentRecieve(msg.sender, msg.value);
        payable(_pieAddress).transfer(msg.value);
    }

    fallback() external payable {
        emit ReceiveUnknownPaymentFallback(msg.sender, msg.value);

        payable(_pieAddress).transfer(msg.value);
    }
}
